import React, { useState } from 'react';
import { Form, Button, Card, Container, Spinner, Alert } from 'react-bootstrap';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Editor from '@monaco-editor/react';

// 1. Import new icon for the hero
import { FaSave, FaTerminal } from 'react-icons/fa';

const HomePage = ({ theme }) => {
  const [content, setContent] = useState('');
  const [language, setLanguage] = useState('javascript');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  // ... (handleSubmit and handleEditorChange functions are unchanged)
  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');
    try {
      const response = await axios.post('http://localhost:5000/api/snippets', {
        content,
        language
      });
      navigate(`/snippet/${response.data.id}`);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to save snippet. Try again.');
      setIsLoading(false);
    }
  };
  function handleEditorChange(value, event) {
    setContent(value);
  }

  return (
    // 2. Use a <Container> for proper spacing, but no 'mt-4'
    <Container fluid>

      {/* 3. This is the new, redesigned Hero Section */}
      <div className="hero-section">
        <div className="hero-icon">
          <FaTerminal />
        </div>
        <h1>Share & Analyze Code</h1>
        <p className="lead">
          Paste your code, save it, and get instant analysis. Errors are
          highlighted just like in your editor.
        </p>
      </div>

      <Card className="editor-card mb-4">
        <Card.Header as="h3" className="text-center">Create New Snippet</Card.Header>
        <Card.Body>
          <Form onSubmit={handleSubmit}>
            <Form.Group className="mb-3">
              <Form.Label>Language</Form.Label>
              <Form.Select 
                value={language} 
                onChange={(e) => setLanguage(e.target.value)}
              >
                <option value="javascript">JavaScript</option>
                <option value="python">Python</option>
                <option value="html">HTML</option>
                <option value="css">CSS</option>
                <option value="java">Java</option>
                <option value="plaintext">Plain Text</option>
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Code</Form.Label>
              {/* 4. Use CSS variable for the border */}
              <div style={{ border: '1px solid var(--border-dark)', borderRadius: '.25rem', overflow: 'hidden' }}>
                <Editor
                  height="60vh"
                  theme={theme === 'dark' ? 'vs-dark' : 'vs-light'}
                  language={language}
                  defaultValue="// Paste your code here..."
                  onChange={handleEditorChange}
                  options={{ minimap: { enabled: true } }}
                />
              </div>
            </Form.Group>

            {error && <Alert variant="danger">{error}</Alert>}

            <Button variant="primary" type="submit" disabled={isLoading} className="w-100 py-2">
              <FaSave className="me-2" />
              {isLoading ? 'Saving...' : 'Save & Share'}
            </Button>
          </Form>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default HomePage;
